import { Link } from "react-router-dom";
import './card.css'

export default function Card(props){
    return (
        <Link to={`/housing/${props.id}`} className="card" style={{backgroundImage: `url(${props.cover})`}}>
            <div className="a">
                <div className="vide"></div>
                <div>
                    <p className="textCard">{props.title}</p>
                </div>
            </div>
        </Link>
    )
}
